import { createContext, useEffect, useState } from 'react';
import React from 'react';



function login (){
    return(
        <div>
            <h1>Login</h1>
        </div>
    )
}

export function UserContext({children}){
    const [loggedIn, setLoggedIn] = useState(true);
    return(
        <div>
            
            {loggedIn ? children : <p>Not Logged In</p>} 
        </div>
    )
}
